package com.active.bean;import java.util.Date;/** * 这是一个类说明 * * @author ta * @date 2019/7/1 下午11:13 * @since 1.0 */public class DriveInfo {    private Long id;    private String name;    private String mobile;    /**身份账号**/    private String idNumber;    /**城市**/    private String cityName;    /**车型**/    private String carModal;    private Date createTime;    private Date updateTime;    /**预约时间**/    private String appointment;    /**经销商**/    private String dealer;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getIdNumber() {        return idNumber;    }    public void setIdNumber(String idNumber) {        this.idNumber = idNumber;    }    public String getCityName() {        return cityName;    }    public void setCityName(String cityName) {        this.cityName = cityName;    }    public String getCarModal() {        return carModal;    }    public void setCarModal(String carModal) {        this.carModal = carModal;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public String getAppointment() {        return appointment;    }    public void setAppointment(String appointment) {        this.appointment = appointment;    }    public String getDealer() {        return dealer;    }    public void setDealer(String dealer) {        this.dealer = dealer;    }}